from typing import List


class Solution:

    def twoSum(self, numbers: List[int], target: int) -> List[int]:
        i = 0
        next_i = 1
        while i < len(numbers):
            j = i + 1
            i_num = numbers[i]
            skip_period = True
            while j < len(numbers):
                j_num = numbers[j]

                if i_num + j_num == target:
                    return [i, j]

                if j == next_i and i_num != j_num:
                    skip_period = False

                if skip_period and j_num == i_num:
                    next_i = j
                else:
                    skip_period = False

                j += 1

            i = next_i
            next_i = i + 1


def test_case1():
    i = [1, 2, 3, 4, 4, 9, 56, 90]
    target = 8
    assert Solution().twoSum(i, target)


